import React from "react";
import Form from "./Form";

class App extends React.Component {
  render() {
    return (
      <div className="container">
        <div className="logo">
          <div className="ui header">Stalk</div>
          <i class="low vision icon"></i>
          <div className="ui header">Your Prof</div>
        </div>
        <Form></Form>
      </div>
    );
  }
}
export default App;
